    props.booklist[0],
    props.booklist[1],
    props.booklist[2],
    props.booklist[3],
    props.booklist[4],
    props.booklist[5],
  ];
  console.log("메인페이지데이터6개");
  console.log(data);
  return (
    <>
      <div className="banner">
        <img src="/bannerImg.png" alt="" />
      </div>
      <BookList data={data} />
    </>
  );
}

export default Main;
